interface ExampleProps {
    message: string;
    optionalMessage?: string;
}

const Example = ({
    message,
    optionalMessage
}: ExampleProps) => {
    console.log('Example props');
    console.log('Message: ', message, '. Type: ', typeof message);
    console.log('optionalMessage: ', optionalMessage, '. Type: ', typeof optionalMessage);

    return <div>
    <h2>{message}</h2>
    <h1>{optionalMessage ?? 'No message'}</h1>
    </div>
}

export default Example;
